import { ReactSVG } from "react-svg";

import londonImg from "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.visitlondon.com%2F&psig=AOvVaw0PlcgoYCjHq62D0TB831pc&ust=1675287520295000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCLCytL7i8vwCFQAAAAAdAAAAABAD"


export default function Place () {
    return (
        <div className="place">
            <img scr={londonImg}></img>
        </div>
    )
}
